import React, { useState } from "react";
import SideBar from "./SideBar";

function DashBoard(){
    const [dash, setDash]= useState(true);
        const openDash = () => {
            setDash(true);
        };
    
        const closeDash = () => {
            setDash(false);
        };
    return (
        <div className="grid grid-cols-8 box-border h-screen gap-4 p-5 bg-gradient-to-b from-gray-500 to-gray-900">
        <SideBar closeDash={closeDash}></SideBar>
        {dash && <div className="col-span-6 bg-white bg-opacity-75 rounded-md"></div>}
        </div>
    )
}

export default DashBoard
